import { Provider } from 'react-redux';
import store from '../ck/redux/store';
import Src1 from './src/src1';
import Src2 from './src/src2';

const App = () => (
  <Provider store={store}>
    <Src1 />
    <Src2 />
  </Provider>
);

export default App;
